import React from 'react'

export default function AdminDashboard() {
  function seeAppointmets(){}
  return (


    <React.Fragment>

    <div><h1>AdminDashboard</h1></div>
    <button type="button" className="btn btn-success btn-lg btn-block">reply the quiries</button>

    <button type="button" className="btn btn-warning btn-lg btn-block" onClick={() => seeAppointmets()}>See the patients</button>
    <button type="button" className="btn btn-secondary btn-lg btn-block" >See the doctors </button>
    <button type="button" className="btn btn-secondary btn-lg btn-block" >Add Doctor </button>
    <button type="button" className="btn btn-secondary btn-lg btn-block" >Remove Doctor </button>
  </React.Fragment>
  )
}
